package com.example.fptacademysystem.dto;import java.io.Serializable;public class DepartmentDTO implements Serializable {    private int depid ;    private String depnm;    private String descriptions;    public int getDepid() {        return this.depid;    }    public void setDepid(int depid) {        this.depid = depid;    }    public String getDepnm() {        return this.depnm;    }    public void setDepnm(String depnm) {        this.depnm = depnm;    }    public String getDescriptions() {        return this.descriptions;    }    public void setDescriptions(String descriptions) {        this.descriptions = descriptions;    }}